void MainViewBase::buttonCallbackHandler(const touchgfx::AbstractButton& src)
{
    if (&src == &buttonUp)
    {
        //IncreaseValue
        //When buttonUp clicked call virtual function
        //Call increaseValue
        increaseValue();
    }
    else if (&src == &buttonDown)
    {
        //DecreaseValue
        //When buttonDown clicked call virtual function
        //Call decreaseValue
        decreaseValue();
    }
    else if (&src == &b_toNextScreen)
    {
        //toNextScreen
        //When b_toNextScreen clicked change screen to Graphics_Screen
        //Go to Graphics_Screen with no screen transition
        application().gotoGraphics_ScreenScreenNoTransition();
    }
    else if (&src == &b_toPrevScreen)
    {
        //toPrevScreen
        //When b_toPrevScreen clicked change screen to Main
        //Go to Main with no screen transition
        application().gotoMainScreenNoTransition();
    }
    else if (&src == &tb_1)
    {
        //chooseRB_1
        //When tb_1 clicked call virtual function
        //Call chooseRB_1
        chooseRB_1();
    }
    else if (&src == &tb_2)
    {
        //chooseRB_2
        //When tb_2 clicked call virtual function
        //Call chooseRB_2
        chooseRB_2();
    }
    else if (&src == &tb_3)
    {
        //chooseRB_3
        //When tb_3 clicked call virtual function
        //Call chooseRB_3
        chooseRB_3();
    }
    else if (&src == &tb_4)
    {
        //chooseRB_4
        //When tb_4 clicked call virtual function
        //Call chooseRB_4
        chooseRB_4();
    }
}
